		"Notes": "Beatrix is either the easiest Ultimate yet, or next to impossible | She can be cheesed by bringing a team of 5 Samurai with Retaliate R3+. This method makes you immune to everything except Shock and Holy. Unfortunately, she spams the crap out of them in late phases | The trick is to have at least one good FF9 RS weapon. Give it to your strongest character and try to lock Beatrix into Climhazzard and Seiken Stock Break by forcing her into the next phase before she can use Holy or Shock | You have to bring Advance for your RW, and you want Untapped Power RM and Tempo Flurry or Double Cut on your main retaliator. Gilgamesh should have Armor Strike and Light's Wrath for him RM, Tyro should have Boost, and the other two should have Double Cut and a haste RM. Their gear doesn't matter | You'll have to S/L a few times if you lose 2+ characters to Shock/Holy | The other option is less finnicky, but harder to pull off. Stack mitigations; Protectga, Wall, Power Breakdown and Full Break. If you can bring an offensive RW as well, that's great | Sap will ruin your day, so you need to be able to remove it: anything that applies AoE Regen will work | An AoE heal is also a huge boon (almost required), because Climhazzard is horrible | I would suggest the Advantaliate option, personally; it requires less SBs, less gear, less levels, and less hones",
